import React from 'react'
import './App.css'

function App() {
    const appStyles = { backgroundColor: 'red' }

    return() => {
        <div style={ appStyles }>
            <h1 className="header">Hello World</h1>
            <p>
                Lorem, ipsum dolor sit amet consectetur adipisicing elit. Quod amet dolorem tempora labore molestias veniam voluptatem expedita. Quibusdam nulla eveniet excepturi repudiandae at, placeat facere iure, sint, quae labore illo?
            </p>
        </div>
    }
}

export { App }
